(function(){$('[id^="cite_note-"], [id^="cite_ref-"], .mw-headline[id]:not(.tcc-title > * > *)').each(function(){let e=$(this);mwDev.tools.hashControl.register(e.attr("id"),function(){let t=e.parents(".tcc-section, .mw-collapsible.mw-collapsed");if(t.length==0)return;$(t.get().reverse()).each(function(){$(this).hasClass("tcc-section")&&$(this).tabContentController("select")}),setTimeout(()=>$("html, body").animate({scrollTop:e[0].getBoundingClientRect().top+window.pageYOffset-70},500),100)},!0)})})()